import React from 'react';
import Card from './Card';


const CardList = ({ robots }) => {
    return (
        <div>
            {
                robots.map((user, i) => {
                    return (
                        <Card
                            key={i}
                            id={robots[i].id}
                            name={robots[i].username}
                            catchPhrase={robots[i].company['catchPhrase']}
                        />
                    );
                })
            }
        </div>
    );
}

export default CardList;
